import Abstract from "./components/Abstract";
import ExperienceList from "./components/ExperienceList";
import FormationList from "./components/FormationList";
import Personal from "./components/PersonalInfomation";
import Resume from "./components/Resume";
import SkillList from "./components/SkillList";
import Photo from "./components/PersonalInfomation/Photo";

function App() {
  return (
  <div className="w-full min-h-screen bg-indigo-50/20 p-16">
    <div className="w-100 h-52 bg-[url('./assets/img/gradient.jpeg')]" />
    <div className="relative">
        <div className="absolute -top-10">
          <Photo />
        </div>
    </div>
    <div className="grid grid-cols-3 gap-16">
      <div className='col-span-1 flex flex-col rounded px-16 pb-16 gap-16'>
          <Resume />
          <Personal />
      </div>
      <div className='col-span-2 flex flex-col gap-4'>
        <div  className="flex bg-cyan-400 rounded grow">
          <Abstract />
        </div>
        <div className="flex bg-red-400 rounded grow">
          <FormationList />
        </div>
        <div className="flex bg-teal-400 rounded grow">
          <ExperienceList />
        </div>
        <div className="flex bg-purple-400 rounded grow">
          <SkillList />
        </div>
      </div>
    </div>
  </div>
  );
}

export default App;
